import React from "react";
import './App.css';  // 引入 CSS 文件

export default function App() {
  return (
    <div className="container">
      {/* 左側區塊 */}
      <div className="left-panel">
        <h2>左側區域</h2>
        <p>這是左側區域的內容。</p>
        <p>你可以放置任意內容，例如文章、圖片等。</p>
        <p>繼續滾動查看更多內容。</p>
        <p>繼續滾動查看更多內容。</p>
        <p>繼續滾動查看更多內容。</p>
        <p>繼續滾動查看更多內容。</p>
        {/* 這裡是更多的示範內容，可以讓左側滾動 */}
      </div>

      {/* 右側區塊 */}
      <div className="right-panel">
        <h2>右側區域</h2>
        <p>這是右側區域的內容。</p>
        <p>你可以放置另一組內容，這樣用戶可以同時查看左右內容。</p>
        <p>繼續滾動查看更多內容。</p>
        <p>繼續滾動查看更多內容。</p>
        <p>繼續滾動查看更多內容。</p>
        <p>繼續滾動查看更多內容。</p>
        {/* 這裡是更多的示範內容，可以讓右側滾動 */}
      </div>
    </div>
  );
}
